import{_ as a,c as t,o,ag as s}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"CREATE PROTOCOL","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/CREATE_PROTOCOL.md","filePath":"docs/7x/ref_guide/sql_commands/CREATE_PROTOCOL.md"}'),n={name:"docs/7x/ref_guide/sql_commands/CREATE_PROTOCOL.md"};function r(i,e,c,l,d,h){return o(),t("div",null,e[0]||(e[0]=[s(`<h1 id="create-protocol" tabindex="-1">CREATE PROTOCOL <a class="header-anchor" href="#create-protocol" aria-label="Permalink to &quot;CREATE PROTOCOL&quot;">​</a></h1><p>Registers a custom data access protocol that can be specified when defining a WarehousePG external table.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>CREATE [TRUSTED] PROTOCOL &lt;name&gt; (</span></span>
<span class="line"><span>   [readfunc=&#39;&lt;read_call_handler&gt;&#39;] [, writefunc=&#39;&lt;write_call_handler&gt;&#39;]</span></span>
<span class="line"><span>   [, validatorfunc=&#39;&lt;validate_handler&gt;&#39; ])</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>CREATE PROTOCOL</code> associates a data access protocol name with call handlers that are responsible for reading from and writing data to an external data source. You must be a superuser to create a protocol.</p><p>The <code>CREATE PROTOCOL</code> command must specify either a read call handler or a write call handler. The call handlers specified in the <code>CREATE PROTOCOL</code> command must be defined in the database.</p><p>The protocol name can be specified in a <code>CREATE EXTERNAL TABLE</code> command.</p><p>For information about creating and enabling a custom data access protocol, refer to the <a href="./../../admin_guide/load/topics/g-example-custom-data-access-protocol.html">Example Custom Data Access Protocol</a> documentation.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>TRUSTED : If not specified, only superusers and the protocol owner can create external tables using the protocol. If specified, superusers and the protocol owner can <code>GRANT</code> permissions on the protocol to other database roles.</p><p>name : The name of the data access protocol. The protocol name is case sensitive. The name must be unique among the protocols in the database.</p><p>readfunc= &#39;read_call_handler&#39; : The name of a previously registered function that WarehousePG calls to read data from an external data source. The command must specify either a read call handler or a write call handler.</p><p>writefunc= &#39;write_call_handler&#39; : The name of a previously registered function that WarehousePG calls to write data to an external data source. The command must specify either a read call handler or a write call handler.</p><p>validatorfunc=&#39;validate_handler&#39; : An optional validator function that validates the URL specified in the <code>CREATE EXTERNAL TABLE</code> command.</p><h2 id="notes" tabindex="-1"><a id="section5"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>WarehousePG handles external tables of type <code>file</code>, <code>gpfdist</code>, and <code>gpfdists</code> internally. See <a href="./../../admin_guide/external/s3-protocol.html#amazon-emr/s3_prereq">s3:// Protocol</a> for information about enabling the <code>S3</code> protocol. Refer to <a href="./../../admin_guide/external/pxf-protocol.html">pxf:// Protocol</a> for information about using the <code>pxf</code> protocol.</p><p>Any shared library that implements a data access protocol must be located in the same location on all WarehousePG segment hosts. For example, the shared library can be in a location specified by the operating system environment variable <code>LD_LIBRARY_PATH</code> on all hosts. You can also specify the location when you define the handler function. For example, when you define the <code>s3</code> protocol in the <code>CREATE PROTOCOL</code> command, you specify <code>$libdir/gps3ext.so</code> as the location of the shared object, where <code>$libdir</code> is located at <code>$GPHOME/lib</code>.</p><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>CREATE PROTOCOL</code> is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_PROTOCOL.html">ALTER PROTOCOL</a>, <a href="./CREATE_EXTERNAL_TABLE.html">CREATE EXTERNAL TABLE</a>, <a href="./DROP_PROTOCOL.html">DROP PROTOCOL</a>, <a href="./GRANT.html">GRANT</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,23)]))}const u=a(n,[["render",r]]);export{m as __pageData,u as default};
